CREATE EXTENSION IF NOT EXISTS postgis WITH SCHEMA public;

CREATE TABLE public.author (
    name character varying(64),
    email character varying(32)
);

CREATE TABLE public.cities (
    id integer NOT NULL,
    name character varying(128),
    geogr public.geography(Point,4326)
);

CREATE SEQUENCE public.cities_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.cities_id_seq OWNED BY public.cities.id;

CREATE TABLE public.continents (
    id integer NOT NULL,
    name character varying(128),
    geogr public.geography(MultiPolygon,4326)
);


CREATE SEQUENCE public.continents_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.continents_id_seq OWNED BY public.continents.id;

CREATE TABLE public.flight (
    id integer NOT NULL,
    ftime timestamp without time zone,
    geogr public.geography(Point,4326)
);


CREATE SEQUENCE public.flight_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.flight_id_seq OWNED BY public.flight.id;

CREATE TABLE public.islands (
    id integer NOT NULL,
    name character varying(128),
    geogr public.geography(MultiPolygon,4326)
);

CREATE SEQUENCE public.islands_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.islands_id_seq OWNED BY public.islands.id;

CREATE TABLE public.oceans (
    id integer NOT NULL,
    name character varying(128),
    maxdepth numeric,
    geogr public.geography(MultiPolygon,4326)
);

CREATE SEQUENCE public.oceans_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER SEQUENCE public.oceans_id_seq OWNED BY public.oceans.id;


CREATE TABLE public.paths (
    id integer NOT NULL,
    name character varying(128),
    geogr public.geography(LineString,4326)
);

CREATE SEQUENCE public.paths_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER SEQUENCE public.paths_id_seq OWNED BY public.paths.id;

CREATE TABLE public.seas (
    id integer NOT NULL,
    name character varying(128),
    maxdepth integer,
    geogr public.geography(MultiPolygon,4326)
);

CREATE SEQUENCE public.seas_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE public.seas_id_seq OWNED BY public.seas.id;


ALTER TABLE ONLY public.cities ALTER COLUMN id SET DEFAULT nextval('public.cities_id_seq'::regclass);

ALTER TABLE ONLY public.continents ALTER COLUMN id SET DEFAULT nextval('public.continents_id_seq'::regclass);

ALTER TABLE ONLY public.flight ALTER COLUMN id SET DEFAULT nextval('public.flight_id_seq'::regclass);

ALTER TABLE ONLY public.islands ALTER COLUMN id SET DEFAULT nextval('public.islands_id_seq'::regclass);

ALTER TABLE ONLY public.oceans ALTER COLUMN id SET DEFAULT nextval('public.oceans_id_seq'::regclass);

ALTER TABLE ONLY public.paths ALTER COLUMN id SET DEFAULT nextval('public.paths_id_seq'::regclass);

ALTER TABLE ONLY public.seas ALTER COLUMN id SET DEFAULT nextval('public.seas_id_seq'::regclass);


